import {
  FETCH_LEADS
} from "../actions/types";

const uuidv1 = require("uuid/v1");

export default function leads(state = [], action) {
  switch (action.type) {
    case FETCH_LEADS:
      return action.leads;
    default:
      return state;
  }
}
